ument.body.appendChild(link);\\n\\n    // wait for the link to be added to the document\\n    window.requestAnimationFrame(function() {\\n      var event = new MouseEvent(&#x27;click&#x27;);\\n      link.dispatchEvent(event);\\n      document.body.removeChild(link);\\n    });\\n    "}}]]]},"styles":{"type":"map","entries":[["margin","auto 5px"]]},"label":"Download CSV of Selected Data"}},{"type":"object","name":"Div","id":"p2866","attributes":{"styles":{"type":"map","entries":[["margin","auto -3px auto 5px"]]},"text":"Kepler:"}},{"type":"object","name":"ColorPicker","id":"p2867","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:color",[{"type":"object","name":"CustomJS","id":"p2868","attributes":{"args":{"type":"map","entries":[["other",{"type":"object","name":"Scatter","id":"p2756","attributes":{"x":{"type":"field","field":"teq"},"y":{"type":"field","field":"met"},"size":{"type":"value","value":6},"line_color":{"type":"value","value":"#228833"},"line_alpha":{"type":"value","value":0.4},"fill_color":{"type":"value","value":"#228833"},"fill_alpha":{"type":"value","value":0.4},"hatch_color":{"type":"value","value":"#228833"},"hatch_alpha":{"type":"value","value":0.4},"marker":{"type":"value","value":"circle_cross"}}}]]},"code":"other.fill_color = this.color"}},{"type":"object","name":"CustomJS","id":"p2869","attributes":{"args":{"type":"map","entries":[["other",{"id":"p2756"}]]},"code":"other.hatch_color = this.color"}},{"type":"object","name":"CustomJS","id":"p2870","attributes":{"args":{"type":"map","entries":[["other",{"id":"p2756"}]]},"code":"other.line_color = this.color"}},{"type":"object","name":"CustomJS","id":"p2871","attributes":{"args":{"type":"map","entries":[["other",{"type":"object","name":"Scatter","id":"p2758","attributes":{"x":{"type":"field","field":"teq"},"y":{"type":"field","field":"met"},"size":{"type":"value","value":6},"line_color":{"type":"value","value":"#228833"},"line_alpha":{"type":"value","value":0.8},"fill_color":{"t
